    "for i in range(13):    \n",
    "    # Split dataset to input X and outcome Y\n",
    "    X_train = np.array(boston_dataset_train.iloc[:,i].values).reshape(-1,1)\n",
    "    Y_train = np.array(boston_dataset_train.iloc[:,-1].values)\n",
    "    X_test = np.array(boston_dataset_test.iloc[:,i].values).reshape(-1,1)\n",
    "    Y_test = np.array(boston_dataset_test.iloc[:,-1].values)\n",
    "    fig = plt.subplots(1,3, figsize = (15,4), sharey=True, dpi=120)\n",
    "    name_columns = boston_dataset.columns[i]\n",
    "    plt.savefig(\"Vietnam-covid19.png\",dpi=120)\n",
    "    \n",
    "    #Visualize training data\n",
    "    plt.subplot(1,3,1)\n",
    "    plt.scatter(X_train, Y_train, color = \"red\")\n",
    "    plt.title(\"House price vs %s\"%title_xlabel(i))\n",
    "    plt.xlabel(title_xlabel(i))\n",
    "    plt.ylabel(\"House price (1000 dollars)\")\n",
    "\n",
    "    #Training model\n",
    "    from sklearn.linear_model import LinearRegression\n",
    "    regressor = LinearRegression()\n",
    "    regressor.fit(X_train, Y_train)\n",
    "\n",
    "    #Result Training Set\n",
    "    plt.subplot(1,3,2)\n",
    "    Y_train_pred = regressor.predict(X_train)\n",
    "    plt.scatter(X_train, Y_train, color = \"red\")\n",
    "    plt.plot(X_train, Y_train_pred, color = \"blue\")\n",
    "    plt.title(\"House price vs %s (Training set)\"%title_xlabel(i))\n",
    "    plt.xlabel(title_xlabel(i))\n",
    "    plt.ylabel(\"House price (1000 dollars)\")\n",
    "\n",
    "    #Check result testing set\n",
    "    plt.subplot(1,3,3)\n",
    "    Y_test_pred = regressor.predict(X_test)\n",
    "    plt.scatter(X_test, Y_test, color = \"red\")\n",
    "    plt.plot(X_test, Y_test_pred, color = \"blue\")\n",
    "    plt.scatter(X_test, Y_test_pred, color = \"black\")\n",
    "    plt.title(\"House price vs %s (Testing set)\" %title_xlabel(i))\n",
    "    plt.xlabel(title_xlabel(i))\n",
    "    plt.ylabel(\"House price (1000 dollars)\")\n",
    "    plt.savefig(name_columns+\".png\",dpi=120)\n",
    "    plt.show()\n",
    "    #Model evaluation\n",
    "    print(\"R square (\"+ name_columns +\") =\",r2_score(Y_test, Y_test_pred))"
